import TaskItem from "./TaskItem";

const TasksList = ({tasks, remove}) => {

    return (
        <div>
                {tasks.map((task) =>
                    <TaskItem task = {task} key={task.id}/>
                )}
        </div>
    );
};

export default TasksList;
